<div id="a-shiny-app-for-eulerr" class="section level1">
<h1>A shiny app for <code>eulerr</code></h1>
<p>A <a href="https://www.shinyapps.io/">shiny</a> app for drawing area-proportional euler (venn) diagrams by interfacing the r package <a href="https://CRAN.R-project.org/package=eulerr">eulerr</a>.</p>
<p>The app is available on <a href="https://jolars.shinyapps.io/eulerr">jolars.shinyapps.io/eulerr</a>.</p>
<p>To read more about the r package behind this app, visit its <a href="https://jolars.github.io/eulerr/">homepage</a> or <a href="https://github.com/jolars/eulerr">Github repository</a>.</p>
